import React, { useState } from 'react';
import { connect } from 'react-redux';
import { addLoan } from '../actions/loanActions';
import { Link } from 'react-router-dom';
import {
  Row,
  Col,
  Button,
  Form,
  FormGroup,
  Input,
  Modal,
  ModalHeader,
  ModalBody,
  ModalFooter,
  Card,
  CardBody,
  CardTitle,
  InputGroup,
} from 'reactstrap';

const LoanApplication = ({ addLoan }) => {
  const [modal, setModal] = useState(false);
  const [name, setName] = useState('');
  const [loanAmount, setLoanAmount] = useState('');
  const [loanTerm, setLoanTerm] = useState('');

  const email = localStorage.getItem("email");
  const toggle = () => {
    setModal(!modal);
  };

  const onSubmit = (e) => {
    e.preventDefault();

    const newLoan = {
      name: name,
      loan_amount: loanAmount,
      loan_term: loanTerm,
      createdBy: email
    };

    const _loginUser = async (e) => {
      e.preventDefault();
      try {
          const response = await fetch('http://localhost:8080/api/loans', {
              method: 'POST',
              headers: {
                  'Content-Type': 'application/json',
              },
              body: JSON.stringify({newLoan}),
          });
  
          if (!response.ok) {
              throw new Error(`HTTP error! Status: ${response.status}`);
          }
  
          const data = await response.json();
          console.log("datafdsfdsfvsdv",data)
      } catch (error) {
          console.error('Error during login:', error);
          // Handle the error appropriately, e.g., show an error message to the user
      }
  };

    // Open Modal
    toggle();
  };

  return (
    <div>
      <h1 className="mb-5">Apply for loan</h1>
      <Row>
        <Col sm="12" md={{ size: 8, offset: 2 }}>
          <Card>
            <CardBody>
              <CardTitle className="mb-5">Loan Form</CardTitle>
              <Form onSubmit={onSubmit}>
              <FormGroup>
                  <div className="mb-2">Name</div>
                  <InputGroup size="lg">
                    <div className="input-group-prepend">
                      <span className="input-group-text">$</span>
                    </div>
                    <Input
                      type="text"
                      name="name"
                      id="name"
                      placeholder="Enter Name"
                      onChange={(e) => setName(e.target.value)}
                    />
                  </InputGroup>
                </FormGroup>
                <FormGroup>
                  <div className="mb-2">Loan Amount</div>
                  <InputGroup size="lg">
                    <div className="input-group-prepend">
                      <span className="input-group-text">$</span>
                    </div>
                    <Input
                      type="text"
                      name="loan_amount"
                      id="loan_amount"
                      placeholder="Enter Loan Amount"
                      onChange={(e) => setLoanAmount(e.target.value)}
                    />
                  </InputGroup>
                </FormGroup>
                <FormGroup>
                  <div className="mb-2">Loan Term (in months)</div>
                  <Input
                    type="select"
                    name="loan_term"
                    id="loan_term"
                    onChange={(e) => setLoanTerm(e.target.value)}
                  >
                    <option default>Select One</option>
                    <option value="1">1 month</option>
                    <option value="2">2 months</option>
                    <option value="3">3 months</option>
                    <option value="4">4 months</option>
                    <option value="5">5 months</option>
                  </Input>
                </FormGroup>
                <FormGroup className="mt-5">
                  <Link
                    to="/"
                    size="lg"
                    color="secondary"
                    className="btn btn-outline-secondary btn-lg float-left"
                  >
                    Back
                  </Link>
                  <Button
                    size="lg"
                    color="success"
                    className="float-right"
                    type="submit"
                  >
                    Submit
                  </Button>
                </FormGroup>
              </Form>
            </CardBody>
          </Card>
        </Col>
      </Row>

      <Modal isOpen={modal} toggle={toggle}>
        <ModalHeader toggle={toggle}>Application Submitted</ModalHeader>
        <ModalBody>
          Your loan application was successfully submitted and is under review
          for approval.
        </ModalBody>
        <ModalFooter>
          <Link to={`/all-loans`} className="btn btn-success btn-lg">
            Done
          </Link>
        </ModalFooter>
      </Modal>
    </div>
  );
};

const mapStateToProps = (state) => ({
  loan: state.loan,
});

export default connect(mapStateToProps, { addLoan })(LoanApplication);
